import React, { Component, useState } from "react";

const FormComponent = () => {
	const [email, setEmail] = useState("");

	const changeHandler = (event) => {
		setEmail(event.target.value);
	};

	return (
		<form>
			<input
				type="username"
				name="username"
				value={email}
				onChange={changeHandler}
			/>
			<input
				type="password"
				name="password"
				value={email}
				onChange={changeHandler}
			/>
		</form>
	);
};

export default FormComponent;
